Martin County Fire Rescue saves lives. Thank you to Captain Foster, Chief Shell, and all of our first responders.

My prayers are with the families who have lost loved ones this summer—  these losses are nothing short of devastating, and we’ll continue to work together to raise awareness on maritime safety to prevent these tragedies.  

@MartinCountyFR

Had a great time meeting the Palm Beach County Sheriff’s Office Rapid Response Team, who will be providing security along President Trump’s inauguration parade route. 

Thank you for your dedication to keeping our country safe!

@PBCountySheriff https://t.co/w1hAT9hewL

